package aiVoice

import (
	"Lealra/hf"
	"Lealra/myUtil"
	"Lealra/returnStruct"
	"encoding/base64"
	"io"
	"net/http"
	"regexp"
	"strconv"
	"strings"
)

var initFlag bool

// 根据说话角色名生成
var VoiceMap map[string]*VoiceConfig

// 根据 VITS space 地址生成
var ManipulatorMap map[string]hf.Manipulator

var NameList []string

type VoiceConfig struct {
	Name  string
	Space *Space
}

type Space struct {
	Url           string     `json:"url"`
	LinkMode      string     `json:"linkMode"`
	Mode          int        `json:"mode"`
	InputOp       [][]string `json:"inputOp"`
	SpeakerChoice []string   `json:"speakerChoice"`
	MsgInputOp    []string   `json:"msgInputOp"`
	OutputOp      []string   `json:"outputOp"`
	GenerateOp    []string   `json:"generateOp"`
}

func VoiceGenerateHandler(mjson returnStruct.Message) (string, error) {
	if mjson.RawMessage == "重载语音模型" {
		isFailed, failNum := GetVits()
		if isFailed {
			myUtil.SendGroupMessage(mjson.GroupID, "模型加载时有"+strconv.Itoa(failNum)+"项加载失败")
		}
	}
	index := strings.Index(mjson.RawMessage, "说 ")
	if index == -1 {
		return "", nil
	}
	msg := mjson.RawMessage[index+len("说 "):]
	name := mjson.RawMessage[:index]
	//未初始化相关信息时会进行初始化
	if !initFlag {
		GetVits()
		initFlag = true
	}
	//这查找方式总感觉有点傻乎乎的（为什么不做前缀树加 map 进行优化呢
	for _, n := range NameList {
		if strings.Contains(n, name) {
			name = n
			break
		}
	}
	var m hf.Manipulator
	voice, ok := VoiceMap[name]
	if ok {
		m, ok = ManipulatorMap[voice.Space.Url]
		if !ok {
			myUtil.SendGroupMessage(mjson.GroupID, "正在获取远程信息中...")
			withUrl, err := hf.GetClientWithUrl(voice.Space.Url, true)
			if err != nil {
				return "远程信息获取失败！", err
			}
			ManipulatorMap[voice.Space.Url] = hf.NewManipulatorWithClient(withUrl)
			m = ManipulatorMap[voice.Space.Url]
		}
	} else {
		return "未找到对应人物哦", nil
	}
	myUtil.SendGroupMessage(mjson.GroupID, "正在努力生成中...")
	var err error
	for _, v := range voice.Space.InputOp {
		index = len(v) - 1
		err = m.FindAndSet(v[:index], v[index])
		if err != nil {
			return "输入时出错", err
		}
	}
	if voice.Space.SpeakerChoice != nil {
		err = m.FindAndSet(voice.Space.SpeakerChoice, voice.Name)
		if err != nil {
			return "设置模型角色时出错", err
		}
	}
	if voice.Space.Mode == 3 {
		msg = strings.ReplaceAll(msg, "&#91;", "[")
		msg = strings.ReplaceAll(msg, "&#93;", "]")
		msg = MultiLanguageTextHandler(msg, "ja")
		msg = MultiLanguageTextHandler(msg, "en")
		msg = "[ZH]" + msg + "[ZH]"
	}
	err = m.FindAndSet(voice.Space.MsgInputOp, msg)
	if err != nil {
		return "输入内容时出错", err
	}
	switch voice.Space.LinkMode {
	case "ws":
		ok, err = m.FindAndExecute(voice.Space.GenerateOp, hf.LinkModeWs)
	case "poll":
		ok, err = m.FindAndExecute(voice.Space.GenerateOp, hf.LinkModePoll)
	default:
		ok, err = m.FindAndExecute(voice.Space.GenerateOp, hf.LinkModeWs)
	}
	if err != nil {
		return "调用生成函数时出错", err
	}
	var component *hf.Component
	component, err = m.FindAndGet(voice.Space.OutputOp)
	if err != nil {
		return "获取内容时出错", err
	}
	var ret string
	switch component.Props.Value.(type) {
	case map[string]interface{}:
		if component.Props.Value.(map[string]interface{})["is_file"] == true {
			ret, err = GetBase64OfFile(hf.GetSpaceUrl(voice.Space.Url) + "file=" + component.Props.Value.(map[string]interface{})["name"].(string))
			if err != nil {
				return "", err
			}
		}
	case string:
		ret = "base64://" + component.Props.Value.(string)[strings.Index(component.Props.Value.(string), ",")+1:]
	default:
	}
	//ret = "base64:"
	return "[CQ:record,file=" + ret + "]", nil
}

func GetBase64OfFile(url string) (string, error) {
	res, err := http.Get(url)
	if err != nil {
		return "", err
	}
	defer res.Body.Close()
	data, err := io.ReadAll(res.Body)
	if err != nil {
		return "", err
	}
	str := base64.StdEncoding.EncodeToString(data)
	return "base64://" + str, nil
}

func MultiLanguageTextHandler(text string, language string) string {
	var compile *regexp.Regexp
	if language == "en" {
		compile = regexp.MustCompile("\\[EN\\][^\\[\\]]*\\[EN\\]")
	} else if language == "ja" {
		compile = regexp.MustCompile("\\[JA\\][^\\[\\]]*\\[JA\\]")
	} else {
		return text
	}
	pos := compile.FindAllStringIndex(text, -1)
	ret := ""
	index := 0
	for _, p := range pos {
		ret += text[index:p[0]] + "[ZH]" + text[p[0]:p[1]] + "[ZH]"
		index = p[1]
	}
	ret += text[index:]
	return ret
}

func GetVits() (isFailed bool, failNum int) {
	VoiceMap = make(map[string]*VoiceConfig)
	ManipulatorMap = make(map[string]hf.Manipulator)
	var component *hf.Component
	var withUrl hf.Client
	var err error
	for _, space := range vitsConfig.Spaces {
		withUrl, err = hf.GetClientWithUrl(space.Url, true)
		if err != nil {
			isFailed = true
			failNum++
			myUtil.ErrLog.Println("远程 vits 空间信息获取失败！")
			continue
		}
		ManipulatorMap[space.Url] = hf.NewManipulatorWithClient(withUrl)
		component, err = ManipulatorMap[space.Url].FindAndGet(space.SpeakerChoice)
		if err != nil {
			isFailed = true
			failNum++
			myUtil.ErrLog.Println("远程 vits 空间模型信息整理失败！")
			continue
		}
		for _, name := range component.Props.Choices {
			NameList = append(NameList, name)
			VoiceMap[name] = &VoiceConfig{
				Name:  name,
				Space: &space,
			}
		}
	}
	spaceSet := make(map[string]struct{})
	for i, single := range vitsConfig.Single {
		if _, ok := spaceSet[single.Space.Url]; !ok {
			withUrl, err = hf.GetClientWithUrl(single.Space.Url, true)
			if err != nil {
				isFailed = true
				failNum++
				myUtil.ErrLog.Println("远程 vits 空间信息获取失败！")
				continue
			}
			ManipulatorMap[single.Space.Url] = hf.NewManipulatorWithClient(withUrl)
			spaceSet[single.Space.Url] = struct{}{}
		}
		NameList = append(NameList, single.Speaker)
		VoiceMap[single.Speaker] = &VoiceConfig{
			Name:  single.Speaker,
			Space: &vitsConfig.Single[i].Space,
		}
	}
	return
}
